import { exportHTML } from "../utils/exportHtml";

function Header({ blocks }) {
  return (
    <header className="header">
      <h1>CanvasX</h1>
      <span>Visual Web Builder Studio</span>

      <button onClick={() => exportHTML(blocks)}>
        Export
      </button>
    </header>
  );
}

export default Header;
